import './App.css';
import logo from './dnd-logo.svg';

function App() {
  return (
    <div className="App">
      <header className="p-5 bg-black text-white">
        <img src={logo} className="w-20" alt='logo'/>
      </header>
      <main className="border border-red-500 border-4 p-4">
        <section className="border border-blue-500 border-4">
          <h2>Hello</h2>
        </section>
      </main>
    </div>
  );
}

export default App;
